    false,nt"url": null,nt"notes": "This annual narrative report for Great
    Swamp National Wildlife Refuge outlines Refuge accomplishments during the 1985 calendar
    year. The report begins with a summary of the year's highlights and weather conditions.
    Land acquisition is covered. The report includes a planning section which discusses
    the master plan, management planning, public participation, and research and investigations.
    Refuge administration is outlined; information about personnel, youth programs,
    volunteer programs, funding, and safety is given. Habitat management is also covered;
    subjects include wetlands, grasslands, pest control, and wilderness areas. The wildlife
    section of the report discusses endangered and threatened species, waterfowl, marsh
    birds and waterbirds, shorebirds, raptors, game mammals, scientific collections,
    and marking and bird banding. The public uses of the Refuge described in this report
    include outdoor classrooms, interpretive programs, hunting, and law enforcement.
    The equipment and facilities section of the report provides information about new
    construction, rehabilitation, and equipment replacement. Items of interest are provided
    at the end",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
